import Nav from '../../componenents/navHeader/nav';
import Footer from '../../componenents/footer';
import Promo from '../../componenents/promo/promo';

import PageHW from '../../componenents/whatsappHeader';
import Vantagens from '../../componenents/vantagens';

export default function Whatsapp() {
  return (
    <div className="App  ">
      <Promo />
      <Nav />
      <PageHW />
      <Vantagens />
      <Footer />
    </div>
  );
}
